use std::collections::HashMap;

#[derive(Debug)]
struct Solution {}

impl Solution {
  pub fn count_characters(words: Vec<String>, chars: String) -> i32 {
    let len = chars.len();
    
    let count = |s: String| -> HashMap<char, i32> {
      let mut map = HashMap::new();
      for c in s.chars() {
        let entry = map.entry(c).or_insert(0);
        *entry += 1;
      }
      map
    };
    let chars = count(chars);
    let contains = |map1: &HashMap<char, i32>, map2: HashMap<char, i32>| -> bool {
      for (c, cnt2) in map2.iter() {
        let cnt1 = map1.get(&c).unwrap_or(&0);
        if cnt1 < cnt2 {
          return false;
        }
      }
      true
    };
    let mut ret = 0;
    for word in words {
      let len2 = word.len();
      if len >= len2 && contains(&chars, count(word)) {
        ret += len2;
      }
    }
    ret as i32
  }
}

